         " <p class=\"card-text\"> Location : Israel , Beit jann  </p>"+
          "<p class=\"card-text\">  Northen St. </p>"+
        "</div>"+
      "</div>"
    },
    {
        category:'Interior Design',
        url:'InteriorDesign',
        img:'./img/Categories/interiorDesign4.jpg',
        // type:3
        txt : "<h5 class=\"card-title titleFont secondTitle\"> VISIT UD <\/h5>"
    },
    {
        category:'Kitchens',
        url:'Kitchens',
        img:'./img/Categories/kitchens6.jpg',
        txt:  "<h2 id=\"foo\">HEader with ID property<\/h2>"
        // type:3
    }

]

export default ContactUs;
